// src/App.js
import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import Default from './Pages/Default';
import Login from './Pages/Login';
import Home from './Pages/Home';
import MediaUpload from './Pages/MediaUpload';
import UserProfile from './Pages/UserProfile';
import Navbar from './routes/Navbar';
import Register from './Pages/Register';
import { useAuth } from './hooks/useAuth';

const PrivateRoute = ({ element, ...rest }) => {
  const { isAuthenticated } = useAuth();

  return isAuthenticated ? (
    <Route {...rest} element={element} />
  ) : (
    <Navigate to="/login" replace />
  );
};

const App = () => {
  console.log('Rendering App component.');

  return (
    <Router>
      <Routes>
        <Route path="/" element={<Default />} />
        <Route path="/login" element={<Login />} />
        <Route path="/register" element={<Register />} />
        {/* Use PrivateRoute for routes that require authentication */}
        <PrivateRoute path="/Home" element={<><Navbar /><Home /></>} />
        <PrivateRoute path="/MediaUpload" element={<><Navbar /><MediaUpload /></>} />
        <PrivateRoute path="/UserProfile" element={<><Navbar /><UserProfile /></>} />
      </Routes>
    </Router>
  );
};

export default App;
